   <p1 className="media-heading">Bariloche (Argentina) </p1><br/>
        <img src={props.Foto} class="card-img-top" alt="..."/>
     
 <p>Passagem + Hospedagem  </p>
 <p>Parcele em ate 10 vezes no Cartão</p>
    </div>
    );
    }
